import { GoogleMap, InfoWindowF, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React, { useState } from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

// Center the map on Jharkhand
const center = {
  lat: 23.3441,
  lng: 85.3096,
};

// Coordinates for major districts in Jharkhand including Ormanjhi
const districts = {
  ranchi: [
    { lat: 23.467, lng: 85.268 },
    { lat: 23.464, lng: 85.310 },
    { lat: 23.445, lng: 85.325 },
    { lat: 23.435, lng: 85.300 },
    { lat: 23.455, lng: 85.275 },
  ],
  dhanbad: [
    { lat: 23.789, lng: 86.254 },
    { lat: 23.789, lng: 86.287 },
    { lat: 23.779, lng: 86.287 },
    { lat: 23.779, lng: 86.254 },
  ],
  jamshedpur: [
    { lat: 22.843, lng: 86.185 },
    { lat: 22.843, lng: 86.245 },
    { lat: 22.803, lng: 86.245 },
    { lat: 22.803, lng: 86.185 },
  ],
  bokaro: [
    { lat: 23.151, lng: 86.149 },
    { lat: 23.151, lng: 86.221 },
    { lat: 23.109, lng: 86.221 },
    { lat: 23.109, lng: 86.149 },
  ],
  giridih: [
    { lat: 24.229, lng: 86.289 },
    { lat: 24.229, lng: 86.362 },
    { lat: 24.188, lng: 86.362 },
    { lat: 24.188, lng: 86.289 },
  ],
  ramgarh: [
    { lat: 23.635, lng: 85.664 },
    { lat: 23.635, lng: 85.704 },
    { lat: 23.605, lng: 85.704 },
    { lat: 23.605, lng: 85.664 },
  ],
  deoghar: [
    { lat: 24.472, lng: 86.719 },
    { lat: 24.472, lng: 86.784 },
    { lat: 24.433, lng: 86.784 },
    { lat: 24.433, lng: 86.719 },
  ],
  koderma: [
    { lat: 24.600, lng: 85.534 },
    { lat: 24.600, lng: 85.584 },
    { lat: 24.570, lng: 85.584 },
    { lat: 24.570, lng: 85.534 },
  ],
  palamu: [
    { lat: 24.679, lng: 84.530 },
    { lat: 24.679, lng: 84.660 },
    { lat: 24.600, lng: 84.660 },
    { lat: 24.600, lng: 84.530 },
  ],
  latehar: [
    { lat: 23.759, lng: 84.322 },
    { lat: 23.759, lng: 84.422 },
    { lat: 23.659, lng: 84.422 },
    { lat: 23.659, lng: 84.322 },
  ],
  chatra: [
    { lat: 24.047, lng: 84.793 },
    { lat: 24.047, lng: 84.900 },
    { lat: 23.950, lng: 84.900 },
    { lat: 23.950, lng: 84.793 },
  ],
  simdega: [
    { lat: 22.858, lng: 84.985 },
    { lat: 22.858, lng: 85.055 },
    { lat: 22.800, lng: 85.055 },
    { lat: 22.800, lng: 84.985 },
  ],
  dumka: [
    { lat: 24.253, lng: 87.259 },
    { lat: 24.253, lng: 87.329 },
    { lat: 24.203, lng: 87.329 },
    { lat: 24.203, lng: 87.259 },
  ],
  pakur: [
    { lat: 24.407, lng: 87.470 },
    { lat: 24.407, lng: 87.520 },
    { lat: 24.350, lng: 87.520 },
    { lat: 24.350, lng: 87.470 },
  ],
  ormanjhi: [
    { lat: 23.438, lng: 85.367 }, // Example coordinates for Ormanjhi
    { lat: 23.438, lng: 85.397 },
    { lat: 23.418, lng: 85.397 },
    { lat: 23.418, lng: 85.367 },
  ],
};

// Coordinates for Casa Blanca polygon
const casaBlancaCoords = [
  { lat: 23.442592425229485, lng: 85.4608527 }, // Adjust as needed
  { lat: 23.442692, lng: 85.4608527 },
  { lat: 23.442692, lng: 85.4618527 },
  { lat: 23.442592425229485, lng: 85.4618527 },
];

function MapComponent() {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk", // Replace with your API key
  });

  const [selectedDistrict, setSelectedDistrict] = useState(null);

  const handlePolygonClick = (district) => {
    setSelectedDistrict(district);
  };

  return isLoaded ? (
    <GoogleMap
      mapContainerStyle={containerStyle}
      center={center}
      zoom={6} // Adjust zoom level
    >
      {/* Polygons for all districts */}
      {Object.entries(districts).map(([districtName, coords]) => (
        <PolygonF
          key={districtName}
          paths={coords}
          options={{
            fillColor: 'rgba(0, 150, 150, 0.4)', // Adjust color for visibility
            strokeColor: 'black', // Black border for visibility
            strokeOpacity: 1,
            strokeWeight: 1,
          }}
          onClick={() => handlePolygonClick(districtName)}
        />
      ))}

      {/* Polygon for Casa Blanca */}
      <PolygonF
        paths={casaBlancaCoords}
        options={{
          fillColor: 'rgba(255, 0, 0, 0.4)', // Light red fill
          strokeColor: 'darkred', // Dark red border
          strokeOpacity: 1,
          strokeWeight: 1,
        }}
      />

      {/* Info Window for selected district */}
      {selectedDistrict && (
        <InfoWindowF
          position={center} // You can adjust the position as needed
          onCloseClick={() => setSelectedDistrict(null)}
        >
          <div>
            <h4>You clicked on {selectedDistrict} district!</h4>
          </div>
        </InfoWindowF>
      )}
    </GoogleMap>
  ) : <></>;
}

export default MapComponent;
